import React from "react";

function Greeting (){
    return(
        <div className="board">
        <h1>Hi Hyu!</h1>
        <p>
          Welcome back Hyu. We are glad you are here.<br></br>
          Inspire your work, leave your acheivement.
        </p>
        <button type="button" class="btn btn-dark">
          View your tasks
        </button>
        <button type="button" class="btn btn-dark">
          View timeline
        </button>
      </div>
    );
};

export default Greeting;
